import React from "react";
import { Container, Row, Col } from "reactstrap";

class Footer extends React.Component {
  render() {
    return (
      <Fragment>
        <div className="body">
          <Container>
            <h2>Nos liens utiles</h2>
            <Row>
              <Col xs="6" sm="4" />
            </Row>
          </Container>
        </div>
      </Fragment>
    );
  }
}

export default Footer;
